import React, {Component} from 'react';
import './Weather.css';



const Weather = (props) => {

    const {data, deleteItem} = props;
    console.log(data.icon);

  return(

      <div className='weather'>
          <h3>{data.name}</h3>
          <div>{data.temp}</div>
          <img src={"http://openweathermap.org/img/w/" + data.road + ".png"} alt = "img"/>
          <div className='weather__delete' onClick={deleteItem}>Delete</div>
      </div>

    );

};


class WeatherList extends Component {

    render() {

        const weatherList = this.props.data.map((data) =>

            <Weather data={data} key={data.id} deleteCity = {() => this.props.deleteItem(data.id)} />

        );


        return (

            <div className = "WeatherList">{weatherList}</div>

        );
    }

}


export default WeatherList;
